import './App.css';
import './bounce.css';
import React, {Component} from 'react';
import Typewriter from "typewriter-effect";
import $ from 'jquery'

function App() {

return (
<>
  <div id='intro'>
    <div id='name'>
      <div className="bouncing-text">
        <div className="b">h</div>
        <div className="o">i</div>
        <div className="u">,</div>
      </div>
      <div className="bouncing-text">
        <div className="b">i</div>
        <div className="o">'</div>
        <div className="u">m</div>
        <div className="n">N</div>
        <div className="c">a</div>
        <div className="e">v</div>
        <div className="f">i</div>
        <div className="g">d</div>
      </div>
    </div>
  </div>

  <div  id='aboutMe'>
    <div id='background'>
      <div id='content'>Me</div>
    </div>
    <Typewriter
    onInit={(typewriter)=> {
    typewriter
    .typeString("Who Am I?")
    .start();
    }
    }
    />
  </div>

  <div  id='skills'>
  <div id='background'>
      <div id='content2'>Skills</div>
    </div>
    <Typewriter
    onInit={(typewriter)=> {
    typewriter
    .typeString("Stuff I'm Good At")
    .start();
    }
    }
    />
  </div>

  <div id='contactMe'>
    <Typewriter
    onInit={(typewriter)=> {
    typewriter
    .typeString("Contact Me")
    .start();
    }
    }
    />
  </div>
</>
  
  );
  
}

